import React from 'react'
import './Sidebar.css';

function Sidebar() {
    return (
        <div className="sidebar">
            <h1>I am a sidebar</h1>

            <div className="sidebar__top">
                <h3>Ma room</h3>
            </div>
        </div>
    )
}

export default Sidebar;
